import React from 'react';
import ReactDOM from 'react-dom';
import SocialMedia from './SocialMedia.js'
import './Footer.css'

class Footer extends React.Component {
  render() {
    return (
      <div id="HEADER" className="container-fluid mb-5 ">
        <SocialMedia />
      </div>
    );
  }
}

export default Footer;
